// API con todos los materiales
const API='http://fagm.epizy.com/apimaterial';
const APIPERSONAL='http://fagm.epizy.com/apipersonal';


const encabezadosTabla=document.querySelector('thead');
const tablaMateriales=document.querySelector('.tablas');
const botonAdicionarMaterial=document.querySelector('#btn-adicionar-material');
const mensajeRespuesta=document.getElementById('mensaje');
const numEntrada=document.getElementById('num_entrada');
const proveedor=document.getElementById('proveedor');
const trabajador=document.getElementById('trabajador');
const radioButtonCompra=document.querySelector('#compra');
const radioButtonReintegro=document.querySelector('#reintegro');
const seccionMateriales=document.querySelector('.seccion_materiales');
const listaTrabajadores=document.querySelector('#list_employee');
const botonRegistrar=document.getElementById('boton_registrar');

let parrafoProveedor=document.querySelector('.parrafo_proveedor');
let parrafoTrabajador=document.querySelector('.parrafo_trabajador');

let num=0;
let arrayMateriales=[];
let arrayPersonal=[];
let arrayFilas=[];


botonAdicionarMaterial.addEventListener('click',agregarMaterialEntrada);
radioButtonCompra.addEventListener('click',(e)=>seleccionarTipoEntrada(e,parrafoProveedor,parrafoTrabajador));
radioButtonReintegro.addEventListener('click',(e)=>seleccionarTipoEntrada(e,parrafoTrabajador,parrafoProveedor));

// Funcion que consume API para consultar numeros de entrada existentes y generar un nuevo numero y almacenar en la BD
async function asignarNumEntrada(){
    let response=await fetch(`${API}/num_entrada`);
    numEntrada.value= await response.json();   
}

// Función que muestra el tipo de entrada de material
function seleccionarTipoEntrada(e,option,otherOption){
    if (e.currentTarget.checked){
        option.classList.remove('ocultar');
        otherOption.classList.add('ocultar');
        seccionMateriales.classList.remove('ocultar')
    }    
}
// Se consume API que contiene todos los materiales y se guardan los datos en un array para tenerlos disponibles y utlizarlos 
async function obtenerMateriales(){
    let response=await fetch(API);
    let data=await response.json();   
      arrayMateriales=data;
}
// Se consume API que contiene datos del personal operativo y se guardan los datos en un array para tenerlos disponibles y utlizarlos 
async function obtenerPersonal(){
    let response=await fetch(APIPERSONAL);
    let data=await response.json();   
      arrayPersonal=data;   
      llenarListaPersonal();
}
// Con esta funcion se muestra en elementos input la descripcion, unidad y cantidad en stock de los materiales
 function obtenerDescripcion(codigo,descripcion,unidad){
    let desc=document.getElementById(descripcion);
    let un=document.getElementById(unidad);
        arrayMateriales.forEach((material)=>{
            if (material.id===parseInt(codigo)){
                desc.value=material.descripcion; 
                un.value=material.unidad;            
            }                   
        });        
}
// Se cargan datos del arraymateriales en un elemento html datalist para que el usuario seleccione
function llenarListaMateriales(lista){
    arrayMateriales.forEach(material=>{
        let opcion=document.createElement('option');
        lista.appendChild(opcion);
        opcion.value=material.id;
        opcion.label=material.descripcion;
    });
  }
// Se cargan datos del arraypersonal en un elemento html datalist para que el usuario seleccione
function llenarListaPersonal(){
    arrayPersonal.forEach(persona=>{
        let opcion=document.createElement('option');
        listaTrabajadores.appendChild(opcion);       
        opcion.value=persona.id;
        opcion.label=persona.nombre;
    });
  }  
// Se genera estructura html para que el usuario seleccione la cantidad de items que requiera agregar al documento (entrad/salida)
function agregarMaterialEntrada(){   
    encabezadosTabla.classList.remove('ocultar');
    num++; 
    let filaMaterial=document.createElement('tr');   
    let celdaCodigo=document.createElement('td');
    let celdaDescripcion=document.createElement('td');
    let celdaUnidad=document.createElement('td');
    let celdaCantidad=document.createElement('td');
    let celdaBtnQuitar=document.createElement('td');  
    
    let listaCodigo=document.createElement('datalist');   

   
    let codigo=document.createElement('input');
    
    let descripcion=document.createElement('input');
    let unidad=document.createElement('input');
    let cantidad=document.createElement('input');
    let btnQuitar=document.createElement('img');

    listaCodigo.setAttribute('id','material')    
    codigo.setAttribute('list','material');   
    codigo.setAttribute('id','codigo'+num) 
    codigo.setAttribute('name','codigo'+num); 

    descripcion.setAttribute('size',50);
    descripcion.setAttribute('id','descripcion'+num);
    descripcion.setAttribute('disabled',true);
    unidad.setAttribute('size',5);
    unidad.setAttribute('id','unidad'+num);
    unidad.setAttribute('disabled',true);
    cantidad.setAttribute('size',5);
    cantidad.setAttribute('name','cantidad'+num);
    cantidad.setAttribute('id','cantidad'+num);

    
    btnQuitar.setAttribute('src','public/assets/eliminar.svg');   
    btnQuitar.setAttribute('id','boton_quitar'+num);    
    btnQuitar.style.cursor='pointer';
    
    btnQuitar.addEventListener('click',(e)=>{
        let i=quitarMaterial(e.currentTarget.id);
        console.log(e.currentTarget.id);
        console.log(i);
        tablaMateriales.removeChild(arrayFilas[i]);
        arrayFilas.splice(i,1);});
    
    celdaCodigo.appendChild(listaCodigo);
    celdaCodigo.appendChild(codigo);    
    celdaDescripcion.appendChild(descripcion);
    celdaUnidad.appendChild(unidad);
    celdaCantidad.appendChild(cantidad);
    celdaBtnQuitar.appendChild(btnQuitar);
    filaMaterial.appendChild(celdaCodigo);    
    filaMaterial.appendChild(celdaDescripcion);  
    filaMaterial.appendChild(celdaUnidad);  
    filaMaterial.appendChild(celdaCantidad);  
    filaMaterial.appendChild(celdaBtnQuitar); 
    tablaMateriales.appendChild(filaMaterial);
    //Cada fila generada se agrega en arrayFilas    
    arrayFilas.push(filaMaterial);
    // Se carga el datalist con todos los materiales
    llenarListaMateriales(listaCodigo);
    //Una vez se cargan los codigos en el datalist se llama la funcion para automáticamente se actualizen los 
    // input correspondientes a ese material. 
    leerListas();
}
// Esta función obtiene la cantidad de elementos que el usuario adiciona en la entrada
function leerListas(){
    arrayFilas.forEach((fila)=>{
        let codigo=document.getElementById(fila.children[0].children[1].id);
        let descripcion=document.getElementById(fila.children[1].children[0].id);
        let unidad=document.getElementById(fila.children[2].children[0].id);    
        //Cada vez que el usuario seleccione un material en el datalist se actualiza los input descripcion, unidad, etc...   
       codigo.addEventListener('input',()=>obtenerDescripcion(codigo.value,descripcion.id,unidad.id));
    });    
}
// Se envian datos a la API para guardarlos en la BD
async function enviarDatos(){ 
    if (validarCampos()){
        const form=document.getElementById('form-nueva-entrada');
        const formdata=new FormData(form);
        const response=await fetch('http://fagm.epizy.com/newmat/registrarMaterial',{
            method:'POST',
            body:formdata
        });        
        if (response.status==200){
            mensajeRespuesta.innerHTML=await response.json();
            mensajeRespuesta.style.backgroundColor='#C3FF99';
            mensajeRespuesta.style.border='1px solid green';
            mensajeRespuesta.style.borderRadius='8px';
            mensajeRespuesta.style.color='green'; 
            mensajeRespuesta.style.fontSize='2 rem'; 
            deshabilitarElementos();     
        }
    }else{
        mensajeRespuesta.style.backgroundColor='#FFC6AC';
        mensajeRespuesta.style.border='1px solid red';
        mensajeRespuesta.style.borderRadius='8px';
        mensajeRespuesta.innerHTML="Hay Campos vacios o cantidad menor o igual a cero. Debe Diligenciar todos los campos y/o ingresar cantidades mayores a cero.";
        mensajeRespuesta.style.color='red'; 
        mensajeRespuesta.style.fontSize='2 rem'; 
    }
}
// Se genera documento en formato pdf
function generarPdf(){
    let cod='';
    let descr='';
    let unid='';
    let cant='';
    let fila=100;
    let encabezadoCodigo=tablaMateriales.children[0].children[0].children[0].innerHTML;
    let encabezadoDesc=tablaMateriales.children[0].children[0].children[1].innerHTML;    
    // Se utilliza librerua JSPDF y se crea nueva instancia del objeto
    let doc=new jsPDF();
    // Se llama la función para cargar plantilla del documento
    plantillaPdf(doc,encabezadoCodigo,encabezadoDesc); 
    // Ciclo para obetener los elementos agregados en la tabla   
    for(let i=1;i<tablaMateriales.rows.length;i++){                
            cod=tablaMateriales.rows[i].cells[0].children[1].value;
            descr=tablaMateriales.rows[i].cells[1].children[0].value;
            unid=tablaMateriales.rows[i].cells[2].children[0].value;
            cant=tablaMateriales.rows[i].cells[3].children[0].value;
            doc.setFontSize(10)
            doc.text(20,fila,cod);       
            // altura del documento
            // var pageHeight = doc.internal.pageSize.height
            //Se genera un array cuando la descripcion del material es muy extensa (cada 100 se divide) 
            // Si el array obtenido tiene más de un elemento se realiza un salto de linea
            let texto=doc.splitTextToSize(descr, 100);         
            if (texto.length>1){
                descr=descr.substring(0,49)+'\n'+descr.substring(49,descr.length);
            }
            doc.text(45,fila,descr);
            doc.text(155,fila,unid);
            doc.text(180,fila,cant);
            fila=fila+8;
            //Condicional para generar nueva página si se llega a última linea del listado de los materiales  
            if (fila>=238){
                doc.addPage();
                plantillaPdf(doc,encabezadoCodigo,encabezadoDesc);
                fila=100;
            }
        }   
    doc.save(numEntrada.value);
}

function fechaActual(){
    let today = new Date();
    let now = today.toLocaleString();
    return now;
}
// Plantilla en formato PDF para los documentos de entrada/salida de material
function plantillaPdf(doc,encabezadoCodigo,encabezadoDesc){
    let img='data:image/jpeg;base64,'
    doc.addImage(img, 'JPEG',15,10,40,20);  
    //Fuente del documento 
    doc.setFont("helvetica");
    //Configuración  del encabezado
    doc.setFontSize(20);
    doc.setTextColor(0,0,0);
    doc.setFontType("bold");
    doc.text(105,40,'Registro Entrada De Material ',null,null,'center');
    //Configuración de sección numero del documento
    doc.setFontSize(14)
    doc.text(175,60,'No. Documento: ',null,null,'right');
    doc.setTextColor(255,0,0);
    doc.text(190,60,numEntrada.value,null,null,'right');
    doc.setTextColor(0,0,0);
      //Configuración de la tabla
     doc.rect(10,80,180,160);    
     doc.setFillColor(224, 229, 227 );
     doc.rect(12,84,177,13,'f');
     doc.setFontType("bold");
     doc.text(25,92,encabezadoCodigo,null,null,'center');
     doc.text(70,92,encabezadoDesc,null,null,'center');
     doc.text(160,92,'Unid.',null,null,'center');
     doc.text(180,92,'Cant.',null,null,'center');
    //  configuración para los datos en la tabla
     doc.setFontType("normal");
    //  Configuarcion del pie de página
     doc.text(60,290,'Fecha De impresión: '+fechaActual(),null,null,'center');
}
function deshabilitarElementos(){
    let proveedor=document.getElementById('proveedor');
    let tipoCompra=document.getElementById('compra');
    let tipoReintegro=document.getElementById('reintegro');
    let responsable=document.getElementById('responsable');
    let trabajador=document.getElementById('trabajador');
   
    arrayFilas.forEach((fila)=>{
        let codigo=document.getElementById(fila.children[0].children[1].id);      
        let cantidad=document.getElementById(fila.children[3].children[0].id); 
        let btnQuitar=document.getElementById(fila.children[4].children[0].id);      
        codigo.disabled=true;
        proveedor.disabled=true;
        cantidad.disabled=true;
        tipoCompra.disabled=true;
        tipoReintegro.disabled=true;
        trabajador.disabled=true;
        responsable.disabled=true;
        btnQuitar.disabled=true;
 });
    botonAdicionarMaterial.disabled=true;
    botonRegistrar.disabled=true;
}
function validarCampos(){
    let valorNegativo=0;
    let validacion
    arrayFilas.forEach((fila)=>{
        let codigo=document.getElementById(fila.children[0].children[1].id);      
        let cantidad=document.getElementById(fila.children[3].children[0].id);   
        if (parseFloat(cantidad.value)<=0){
            valorNegativo++;
        }
        if (codigo.value==='' || cantidad.value===''|| valorNegativo>0){
            validacion= false;
        }else if(radioButtonCompra.checked==true && proveedor.value===''){
            validacion= false;
        }else if(radioButtonReintegro.checked==true && trabajador.value===''){
            validacion= false;
        }else{
            validacion= true;
        } 
    });
    return validacion;
    
}
function quitarMaterial(idBoton){
    let numFila=0; 
    let indice;   
    arrayFilas.forEach((fila)=>{
        if(fila.children[4].children[0].id===idBoton){
            // cuando coincide con el id con el nombre del boton quitar que se pasa como parametro se guarda ese numero
            // de fila para retornarlo.
            indice=numFila;
        }
        // Se recorre el array y se guarda el numero de fila
        numFila++;
    }); 
    return indice;   
}
asignarNumEntrada();
obtenerMateriales();
obtenerPersonal();


